import React from 'react'
import SearchIcon from '@mui/icons-material/Search';

function Searchbar() {
  return (
    <div className='bg-searchbg h-[50px] flex px-5 py-2 justify-between'>
        <input className='w-[220px] rounded-[10px]'><SearchIcon /></input>
        <button className='bg-orange rounded-[10px] px-5 py-2 text-xs font-bold'>List Property</button>
    </div>
  )
}

export default Searchbar
